// JavaScript source code
import React from 'react';
import { username, userid } from '../App';

function Balance() {
    return (
        <div className={'div1'}>
            <username.Consumer>
                {
                    username => {
                        return (
                            <div>
                            <userid.Consumer>
                                {
                                    userid => {
                                        return (
                                            <div>
                                            <h3>the user id is {userid}</h3>
                                                <h3>UserName is "{username}"</h3>
                                            </div>
                                        )
                                    }
                                }
                            </userid.Consumer>
                            
                            
                                
                            </div>
                            )
                    }
                }
            </username.Consumer>
            

            </div>
        );
}
export default Balance;
